import 'styles/page/joinFinish.css'


function MyPage() {
  return (
    <main id="main" className="container left_p">
       <h1 className=''>My Porsche</h1>
       <div>
            <h2>My Reservation</h2>
            <p>딜러와의 예약을 통해 꿈의 차인 포르쉐를 소유하세요</p>
       </div>
       <h2>내가 저장한 즐겨찾기</h2>
    </main>
  );
}

export default MyPage;
